import useFetch from './hooks/fetch'
import NavBar from './Components/NavBar'
import './style.css'

function App() {
	const {loding, error, data } = useFetch('http://localhost:1337/api/home?populate[Header][populate]=%2A&populate[ButtonIntro][populate]=%2A&populate[ButtonCta][populate]&populate[ImageHeroBanner][populate]')

	if (loding) return <p>loading...</p>
	if (error) return <p> Error</p>
	return (
		<div className='container'>
		<NavBar />
			<div className='Content'>
					<h1>{data.Title}</h1>
					<h2> {data.SubTitle} </h2>
					<div>
						<button className='btnIntro'> 
							{data?.ButtonIntro.Title} 
							<img src={`http://localhost:1337`+data?.ButtonIntro.Icon.data.attributes.url} 
							alt={data?.Header.Logo.data.attributes.name} /> 
						</button>
						<button className="btnCta">
						{data?.buttonCta.Title}
						{data?.buttonCta.id}
						</button>
					</div>
				</div>
		</div>
	);
}

export default App;
